import React, { Component } from 'react';


class Home extends Component {
	constructor(props) {
  		super(props);
  }

  render(){
		return (
      <div class="container">
        <h1>Welcome to Game Center!</h1>
				<p>Features the following games:</p>
				<p>Memory Game:</p>
				<p>This is a version of the classic memory game implemented in React.</p>
				<p>Sudoku:</p>
				<p>This is a version of the classic memory game implemented in React.</p>
      </div>
		)
	}
}

export default Home;
